import React, { useContext, useEffect } from 'react'
import { BreakContexte } from '../contexte/BreakContexte'



const Acteurs = () => {

    const {fetchActeurs, acteurs} = useContext(BreakContexte)

    useEffect(() => {
        fetchActeurs();
    }, [])


  return (
    <div className='py-10 px-6'>
      <div>
        {acteurs.map((acteur) => (
          <div>{acteur.name}</div>
        ))}
      </div>     
    </div>
  )
}

export default Acteurs
